import React from 'react'

export const Cardcopadam = () => {

  const cardata = [
   
    { id:1 , img:'/series/copadam/copadam.jpg' , alt:'copadam', },

  ]
  return (
    <div>
    {cardata.map((item)=>{
      return(
    
    <div className='card-container'  >
        <div className='image-container'>
        <a href={item.url}> <img src={item.img} alt={item.alt} /> </a>
        </div>
    </div>

      );
  } )}
    </div>
  )
}
